// TARGET_BACKEND: JVM_IR
// STRING_CONCAT: indy-with-constants
// There are 65000 `0` symbols each encoded with 1 byte + 3 surrogate pairs which encoded with 6 bytes (3 byte first part + 3 byte second),
// first pair should be splitted in test

fun test(s0: String, s1: String, s2: String): String {
    return s0 + "" +
            s1 + "\uD83C\uDF09\uD83C\uDF10\uD83C\uDF10" + s2
}

fun test2(s0: String, s1: String): String {
    return s0 + "\uD83C\uDF09\uD83C\uDF10\uD83C\uDF10" + s1
}

fun test3(): String {
    return "\uD83C\uDF09\uD83C\uDF10\uD83C\uDF10"
}

fun box() : String {
    if (test("", "", "").length != 65536) return "fail 1: ${test("", "", "").length}"
    if (test("", "", "") != test2("", "")) return "fail 2: ${test("", "", "")} != ${test2("", "")}"
    if (test("", "", "") != test3()) return "fail 3: ${test("", "", "")} != ${test3()}"
    val result = test3()
    for (i in 0 until 65530) {
        if (result[i] != '0') return "fail: $i"
    }

    val tail = result.substring(65530, 65536)
    if (tail != "\uD83C\uDF09\uD83C\uDF10\uD83C\uDF10") return "fail tail comparison: $tail"

    return "OK"
}